import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import Singlebook from "./SingleBook";

const Home = ({ books }) => {
  return (
    <div>
      <Container>
        <Row className="g-4" xs={2} md={4}>
          {books.map((b) => (
            <Col className="col-4">
              <Singlebook book={b} />
            </Col>
          ))}
        </Row>
      </Container>
    </div>
  );
};

export default Home;

